import React from 'react'

const MapPosts = () => {
    return (
        <div>
            {data.allPosts.map(({ user: { username }, title, posted, id }) => {
                return (
                    <Post 
                        key={id} 
                        username={username}
                        title={title}
                        posted={posted}
                        id={id}
                    />
                    
                )})}
        </div>
    )
}

export default MapPosts
